import {StyleSheet, View} from 'react-native'

export const styleForm = {
    view: {
        alignItems: 'center',
        paddingTop: 10,
        paddingBottom: 10
    },
    input: {
        marginBottom: 10
    },
    btnContainer: {
        marginTop: 20,
        width: '90%'
    },
    btnUpdate: {
        backgroundColor: '#1A89E7',
        borderRadius: 10
    }
}

export const styles = StyleSheet.create(styleForm)
